// src/Page.js
import React, { useState, useEffect } from 'react';
import { fetchPage } from './api'; // Assuming you have an API file that exports the fetchPage function

const Page = ({ slug }) => {
  const [page, setPage] = useState(null);

  useEffect(() => {
    const getPage = async () => {
      const data = await fetchPage(slug); // Fetch the page by slug
      setPage(data);
    };
    getPage();
  }, [slug]);

  if (!page) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>{page.title.rendered}</h1>
      <div dangerouslySetInnerHTML={{ __html: page.content.rendered }}></div>
    </div>
  );
};

export default Page;
